`memcpy` là một hàm trong thư viện C Standard Library. Nó được sử dụng để sao chép một khoảng nhớ từ một địa chỉ vào một khoảng nhớ khác.

```c
void* memcpy(void* dest, const void* src, size_t n);
```

- `dest`: địa chỉ nhớ đích.
- `src`: địa chỉ nhớ nguồn.
- `n`: số byte cần sao chép.

Ví dụ:

```c
#include <stdio.h>
#include <string.h>

int main() {
    char str1[] = "Hello, World!";
    char str2[20];

    memcpy(str2, str1, strlen(str1) + 1);
    printf("Copied string: %s\n", str2);

    return 0;
}
```

