import string

def caesar_cipher(text, shift):
    result = ""
    for char in text:
        if char in string.ascii_letters:
            ascii_offset = ord('a') if char.islower() else ord('A')
            result += chr((ord(char) - ascii_offset + shift) % 26 + ascii_offset)
        else:
            result += char
    return result

def find_shift(text):
    shifts = []
    for i in range(26):
        shifted_text = caesar_cipher(text, i)
        if shifted_text.startswith(text) or shifted_text.endswith(text):
            shifts.append(i)
    return shifts

def find_symmetry_key(text):
    shifts = find_shift(text)
    for shift in shifts:
        reversed_shift = 26 - shift
        reversed_text = caesar_cipher(text[::-1], reversed_shift)
        if reversed_text == text:
            return shift
    return None

def crack_password(text):
    key = find_symmetry_key(text)
    if key:
        password = caesar_cipher(text, key)
        print(f"The password is: {password}")
    else:
        print("Could not find the password.")

